// src/App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Register from "./components/Auth/Register";
import Login from "./components/Auth/Login";
import CarList from "./components/Cars/CarList";
import CarUploadForm from './components/Cars/CarUploadForm';
import Logout from './components/Auth/logout'; // ✅ new
import { AuthProvider } from './context/AuthContext';

function App() {
  return (
    <AuthProvider>
      <Router>
        <nav>
          <Link to="/">Cars</Link> |
          <Link to="/upload-car">Upload Car</Link> |
          <Link to="/login">Login</Link> |
          <Link to="/register">Register</Link> |
          <Link to="/logout">Logout</Link>
        </nav>

        <Routes>
          <Route path="/" element={<CarList />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/upload-car" element={<CarUploadForm />} />
          <Route path="/logout" element={<Logout />} /> {/* ✅ new route */}
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
